import React, { Component } from 'react';
import AddressItem from './AddressItem';

class AddressInput extends Component {
  constructor(props) {
    super(props);
  }

  handleChange(evt) {
    this.props.onChange(evt);
  }

  render() {
    return (
      <div >
        <div>
          <AddressItem label="Rua" value={this.props.street}  placeholder="" />
          <AddressItem label="Cidade" value={this.props.city} placeholder="" />
          <AddressItem label="Código Postal" value={this.props.postalCode} placeholder="" />
          <AddressItem label="País" value={this.props.country} placeholder="" />
        </div>
      </div>
    );
  }
}

export default AddressInput;
